import '../styles.css';
import Square from './Square';

function Board() {
    return (
        <div>
            <div className="board-row">
                <Square value={1}/>
                <Square value={2}/>
                <Square/>
            </div>
            <div className="board-row">
                <Square/>
                <Square/>
                <Square/>
            </div>
            <div className="board-row">
                <Square/>
                <Square/>
                <Square/>
            </div>
        </div>
    );

}

export default Board;
